import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import store from "./store"
import {Provider} from "react-redux"

ReactDOM.render(
    <div className="Index">
    <Provider store={store}><App /></Provider>
  </div>
,
  document.getElementById('root')
);
